import axios from 'axios';

const api = axios.create({
    baseURL: "http://localhost:3333",
    timeout: 1000,
    headers: {'Access-Control-Allow-Origin': '*'},
    headers: {'Access-Control-Allow-Methods': 'GET, POST'},
  
})

export default api;
